import { type } from "../contants";

export default (state = "", { type }) => {
  switch (types) {
    case type.SET_MESSAGE:
      return "The email was succesfully validated.";
    case type.RESET_MESSAGE:
      return "Every thing is reset now";
    default:
      return state;
  }
};
